import Modal from 'react-modal';
import Container from "./styles";

export const NewTransactionModal = (props) => {

  const { isOpen, onRequestClose } = props;

  return (
    <Modal
      isOpen={ isOpen }
      onRequestClose={ onRequestClose }
    >
      <Container>
        <h2>Cadastrar informações</h2>

        <input
          placeholder="T" 
        />
      </Container>
    </Modal>
  );
};
